const PopCard = ({id, name, song, album, date}) => (
	<div classNmae='popcard'>
		<h2>{name}</h2>
		<h2>{song}</h2>
		<h4>Album/Single: {album}</h4>
		<p>Realease Date: {date}</p>
	</div>
)


export default PopCard;
